  return (
    <div className={s.main}>
      <ProfileInfo ava="https://upload.wikimedia.org/wikipedia/commons/f/f5/Pic-vk-allaboutme-ava-2.jpg" status="Учу React JS" />
      <MyPosts postData={props.data.posts} />
    </div>
  );
};

export default Profile;
